import "./Home.css";
import { Link } from "react-router-dom";
import { useState } from "react";
import { useRef } from "react";
import Smovies from "../components/smovie";
const Search = () => {
  const [disp, setdisp] = useState(null);
  const nav = useRef();
  function toogle() {
    if (disp == null) {
      setdisp("show");
      nav.current.style.background = "black";
    } else {
      setdisp(null);
      nav.current.style.background = "none";
    }
  }
  return (
    <>
      <>
        <div className="nav" ref={nav}>
          <div className="logo">
            <Link to="/">
              <img
                src="./images/netflix-logo-png-2583.png"
                className="logo-l"
                alt=""
              />
            </Link>
          </div>
          <div className="items">
            <Link to="/" className="home">
              Home
            </Link>
            <Link to="/movies" href="#type">
              Hollywood
            </Link>
            <Link to="/bollywood" href="#type">
              Bollywood
            </Link>
          </div>

          <button className="menu2" onClick={toogle}>
            <i className="fa fa-bars"></i>
          </button>
        </div>
        <div className={`menuitems ${disp}`}>
          <Link to="/" className="home">
            Home
          </Link>
          <Link to="/movies" href="#type">
            Hollywood
          </Link>
          <Link to="/bollywood" href="#type">
            Bollywood
          </Link>
        </div>
      </>
    </>
  );
};

export default Search;
